import { useState } from 'react';
import { toast } from 'react-toastify';
import { useAuth } from '../../contexts/AuthContext';
import { useLoading } from '../../contexts/LoadingContext';
import { validateRegister } from '../../validations/userValidate';

function RegisterForm({ onSuccess }) {
	const { register } = useAuth();
	const { startLoading, stopLoading } = useLoading();

	const [input, setInput] = useState({
		firstName: '',
		lastName: '',
		emailOrMobile: '',
		password: '',
		confirmpassword: '',
	});

	const handleChangeInput = (e) => {
		setInput({ ...input, [e.target.name]: e.target.value });
	};

	const handleSubmitForm = async (e) => {
		e.preventDefault();
		const { error } = validateRegister(input);

		if (error) {
			return toast.error(error.message);
		}
		try {
			startLoading();
			await register(input);
			toast.success('success register');
			onSuccess();
		} catch (err) {
			toast.error(err.response.data.message);
		} finally {
			stopLoading();
		}
	};

	return (
		<div>
			<div className='p-3 bg-yellow-400 text-center text-lg'>
				<h1>Account</h1>
			</div>
			<div className='container-sm mt-4 mx-auto p-5' id='form'>
				<div className='row'>
					<div className='p-3 bg-warning bg-opacity-5 border border-dark border-start border-opacity-10 rounded-end shadow'>
						<div className='col-md-6 offset-md-3'>
							<div className='signup-form'>
								<h5 className='mt-3'>CREATE AN ACCOUNT</h5>
								<form id='form' className='mt-3' onSubmit={handleSubmitForm}>
									<div className='row'>
										<div className='mb-3 col-md-6'>
											<label>First Name </label>
											<input
												type='text'
												name='firstName'
												className='form-control'
												value={input.firstName}
												onChange={(e) => handleChangeInput(e)}
											/>
										</div>
										<div className='mb-3 col-md-6'>
											<label>Last Name </label>
											<input
												type='text'
												name='lastName'
												className='form-control'
												value={input.lastName}
												onChange={handleChangeInput}
											/>
										</div>
										<div className='mb-3 col-md-7'>
											<label>Email</label>
											<input
												type='text'
												name='email'
												className='form-control'
												placeholder='exmaple@mail.com'
												value={input.emailOrMobile}
												onChange={(e) => handleChangeInput(e)}
											/>
										</div>

										<div className='mb-3 col-md-12'>
											<label>Password</label>
											<input
												type='password'
												name='password'
												className='form-control'
												value={input.password}
												onChange={handleChangeInput}
											/>
										</div>
										<div className='mb-3 col-md-12'>
											<label>Confirm Password</label>
											<input
												type='password'
												name='confirmpassword'
												className='form-control'
												value={input.confirmpassword}
												onChange={handleChangeInput}
											/>
										</div>
										<button
											type='submit'
											className='mt-3 mx-auto btn btn-outline-dark text-light col-md-5 offset-md-3'
										>
											Register
										</button>
									</div>
								</form>
								<p className='text-center mt-2 ms-8'>
									you have account ?,
									<a href='http://localhost:3000/login'>Login Now</a>
								</p>
							</div>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}
export default RegisterForm;
